window.bookSummaryJSON = "<p>It's time for a boss fight!</p> <p>When the world's number one hero comes to Sam and his team of heroes-in-training with dire news of a secret villain group that threatens the whole world, it's time to Level Up like never before. The difficulty level has been turned up to hardcore mode, but if Sam can just get enough levels and complete enough quests, he might just have a chance to lead his team to victory and save the world.</p> <p>That is, if the terrible truth behind the villains doesn't break the game entirely.</p> <p><i>Warning:</i> This audiobook contains awesome super powers, hot women, sex scenes, collapsing buildings, strange gadgets, crazy power leveling, and the ability to become the strongest person the Universe has ever seen. That’s right, we said Universe.</p>"; 
